'use strict';

const Product = require('../models/product');
const mongoose = require('mongoose');

mongoose.connect('mongodb://localhost:27017/shopping');

const products = [
    new Product({
        imagePath: "data:image/jpeg;base64,",
        title: "Gothic Video Game",
        description: "Awesome Game!!",
        price: 10
    }),    
    new Product({
        imagePath: "data:image/jpeg;base64,",
        title: "Grand Theft Auto Video Game",
        description: "Awesome Game!!",
        price: 15
    }),    
    new Product({
        imagePath: "data:image/jpeg;base64,",
        title: "The Legend of Zelda Video Game",
        description: "Awesome Game!!",
        price: 16
    }),    
    new Product({
        imagePath: "data:image/jpeg;base64,",
        title: "God of War Video Game",
        description: "Awesome Game!!",
        price: 14
    }),   
    new Product({
        imagePath: "data:image/jpeg;base64,",
        title: "Super Mario Video Game",
        description: "Awesome Game!!",
        price: 14
    }),    
    new Product({
        imagePath: "data:image/jpeg;base64,",
        title: "Skyrim Video Game",
        description: "Awesome Game!!",
        price: 20
    })             
]

let done = 0;

for (let i = 0; i < products.length; i++) {
    products[i].save((err, result) => {
        done++;
        if (done === products.length) {
            exit();
        }
    });
}

function exit() {
    mongoose.disconnect();
}
